	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 399px; min-height: 407px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 389px; min-height: 397px;\"><p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Kjøttproduksjon er, som hovedregel, den minst effektive måten å mette verdens voksende befolkning på. 36% av alt korn produsert på verdensbasis går til dyrefôr. </span></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Vi metter flere og forurenser mindre hvis vi spiser korn, frukt og grønt selv istedenfor å bruke det til dyrefôr.</span></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt;\">​</span></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Et hektar jord kan gi mat til 20-25 mennesker om det dyrkes korn og rotfrukter, men bare til ett menneske om det skal produseres kjøtt og melk på samme areal. Det skal også 200 ganger så mye vann til å produsere en kg kjøtt enn til en kg potet.</span></p></div></div>",
